import React from 'react';
import logo from './logo.svg';
import './App.css';
import MarkdownViewer from './MarkdownViewer'

function App() {
  let content = `
countably infinite한 두 집합을 $A$, $B$라고 하자. 이제 아래 과정을 따라 명제를 증명한다.

1. $A \cap B = \varnothing$일 때,

`;

  return (
    <MarkdownViewer source={content}/>
  );
}

export default App;
